// Function to filter data by OEM
const filterByOEM = (oem) => data.filter(item => item.OEM === oem);

// Function to filter data by Material Code
const filterByMaterialCode = (code) => data.filter(item => item.MaterialCode.toUpperCase().includes(code.toUpperCase()));

// Function to render table rows
const renderTableRows = (filteredData) => {
    const tableBody = document.getElementById('material-table').getElementsByTagName('tbody')[0];
    tableBody.innerHTML = '';

    const fragment = document.createDocumentFragment();
    filteredData.forEach(item => {
        const row = document.createElement('tr');
        row.innerHTML = `
            <td>${item.OEM}</td>
            <td>${item.MaterialCode}</td>
            <td>${item.MinTensileStrength}</td>
            <td>${item.MaterialDescription}</td>
            <td>${item.Type}</td>
            <td>${item.Coating}</td>
        `;
        fragment.appendChild(row);
    });
    tableBody.appendChild(fragment);
};

// Event listener for OEM selection
document.getElementById('oem-select').addEventListener('change', function() {
    const selectedOEM = this.value;
    const filteredData = filterByOEM(selectedOEM);
    renderTableRows(filteredData);
});

// Event listener for Material Code search
document.getElementById('material-search').addEventListener('input', function() {
    const searchValue = this.value.trim();
    const filteredData = filterByMaterialCode(searchValue);
    renderTableRows(filteredData);
});

document.getElementById('search-button').addEventListener('click', function() {
    const searchValue = document.getElementById('material-search').value.trim();
    const filteredData = filterByMaterialCode(searchValue);
    renderTableRows(filteredData);
});